package com.pchen;

import com.pchen.model.Image;
import com.pchen.util.Storage;

public class Main {

    public static void main(String[] args) {
        System.out.println("TEST");
        String b64 = "data:image/jpeg;base64,";
        Image image = new Image(b64);
        Storage storage = Storage.getInstance();
        int imageId = image.getImageId();
        System.out.println(storage.addImage(image));
        System.out.println(storage.getImage(imageId));
        System.out.println(storage.updateImage(image));
        System.out.println(storage.deleteImage(imageId));
        for (int i = 0; i < 20; i++) {
            Image tmp = new Image(b64);
            System.out.println(tmp.getImageId());
            storage.addImage(tmp);
        }
        System.out.println(storage.getAllImages());
    }

}
